import React from "react"
const Login = React.lazy(() => import('@pages/login'));
const Register = React.lazy(() => import('@pages/register'));
const Home = React.lazy(() => import('@pages/home'));
const routeMap = [

  // 登录
  {
    path: "/login",
    name: "login",
    component: Login,
    auth: false,
  },
  // 注册
  {
    path: "/register",
    name: "register",
    component: Register,
    auth: false,
  },
  // 首页
  {
    path: "/home",
    name: "home",
    component: Home,
    auth: true,
  },
]
export default routeMap
